import React, { useState, useEffect } from 'react';
import axios from 'axios';

function SearchTrails() {
  const [trails, setTrails] = useState([]);

  useEffect(() => {
    const fetchTrails = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/trails'); // Adjust the endpoint as necessary
        setTrails(response.data.results || []); // Ensure results is defined
      } catch (err) {
        console.error('Error fetching trails:', err);
        setTrails([]); // Set trails to an empty array on error
      }
    };

    fetchTrails();
  }, []); // Empty dependency array ensures this runs once on mount

  return (
    <div>
      <h1>Trails</h1>
      <ul>
        {trails.length > 0 ? (
          trails.map((trail) => (
            <li key={trail.place_id}>
              <h3>{trail.name}</h3>
              <p>{trail.formatted_address}</p>
              <p>Rating: {trail.rating}</p>
            </li>
          ))
        ) : (
          <p>No trails found</p>
        )}
      </ul>
    </div>
  );
}

export default SearchTrails;
